orderfreesearch=function(searchfor,text){
  searchfor=searchfor.replace(/\(/g,'')
  searchfor=searchfor.replace(/\)/g,'')
  searchfor=searchfor.replace(/-/g,'')
  text=text.replace(/\(/g,'')
  text=text.replace(/\)/g,'')
  text=text.replace(/-/g,'')
  words=[]
  while (searchfor.search(" ")!=-1){
    words.push(searchfor.slice(0,searchfor.search(" ")))
    searchfor=searchfor.slice(searchfor.search(" ")+1,searchfor.length)
  }
  words.push(searchfor)
  //console.log(words)
  for (i=0;i<words.length;i++){
    if (text.search(words[i])==-1){
      return false
      break
    }
    else {
      text=text.slice(0,text.search(words[i]))+text.slice(text.search(words[i])+words[i].length,text.length)
      //console.log("m"+text+"m")
    }
  }
  text=text.replace(/ /g,"")
  if (text==""){
    return true
  }
  else {
    return false
  }
}
